import React from "react";

class Jumbotron extends React.Component {
  render() {
    return (
      <div className="jumbotron">
         <h1>(React) Google Books Search</h1>
  <p>
    Search for and  Google Books 
  </p>
      </div>
    )
  }
}

export default Jumbotron;
